import React from 'react';
import Button from 'react-bootstrap/Button';
import Popover from 'react-bootstrap/Popover';
import { OverlayTrigger, Alert } from 'react-bootstrap';
import FilmSearch from './FilmSearch';

class AddFilm extends React.Component {
        render() {
        return (
        <div>
            <Alert variant="success">Dude!</Alert>
            <OverlayTrigger
            trigger="click"
            key="bottom"
            placement="bottom"
            overlay={
                <Popover id="popover-positioned-bottom">
                <Popover.Title as="h3">Search film</Popover.Title>
                <Popover.Content><FilmSearch /></Popover.Content>
                </Popover>
            }
            >
                <Button variant="primary" onClick="">I watched something!</Button>
            </OverlayTrigger>
            </div>
        )}
}
export default AddFilm;
